import React, { Component } from 'react';
import axios from 'axios';

class UrlForm extends Component {
  constructor(props) {
    super(props);
  }

  shouldComponentUpdate(nextProps, nextState) {
    if (nextProps.videoId !== this.props.videoId) {
        return true;
    }
    return false;
  }

  handleClick = (e) => {
    e.preventDefault();
    this.props.handleClick(getVideoId(e.target.value));
  }
  render() {
    return (
      <div className="url-form">
        <input
          placeholder="write youtube url"
          ref={this.inputRef}
        />
        <button onClick={this.props.handleClick(this.inputRef.current)}>rearrange</button>
      </div>
    );
  }
}

export default UrlForm;
